import Navbar from "./Components/Navbar/Navbar";
import HelloUser from "./Components/HelloUser/HelloUser";
import Trending from "./Components/Index/Trending/Trending";
import SelectDay from "./Components/Index/SelectDay/SelectDay";

function App() {
  return (<>
        <Navbar/>
        <HelloUser username="Mihai"/>
        <Trending/>
        <SelectDay/>
        <input type="date"/>
    </>

  );
}

export default App;
